INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('I like what you got.', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('I realized that I’m searching, searching for what I really want in life. And you know what? I have absolutely no idea what that is.', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('The first rule of space travel kids is always check out distress beacons. Nine out of ten times it\'s a ship full of dead aliens and a bunch of free shit! One out of ten times it\'s a deadly trap, but... I\'m ready to roll those dice!', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('Uncertainty is inherently unsustainable. Eventually, everything either is or isn\'t.', UTC_TIMESTAMP(), 1);
