INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('Raspberries? Good. Ladyfingers? Good. Beef? GOOD!', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('That\'s the difference between you and me, Morty. I never go back to the carpet store.', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('Whether a gesture’s charming or alarming, depends on how it’s received.', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('We were on a break!', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('It’s just, eventually we’re all gonna move on. It’s called growing up.', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('This sounds like something The One True Morty might say.', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('Oh, are you setting Ross up with someone? Does she have a wedding dress?', UTC_TIMESTAMP(), 1);
