INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('Challenege Accepted', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('There are a lot of little reasons why the big things in our lives happen.', UTC_TIMESTAMP(), 1);
INSERT INTO post (content, time_added, cultural_offering_id) VALUES ('We’re going to get older whether we like it or not, so the only question is whether we get on with our lives, or desperately cling to the past.', UTC_TIMESTAMP(), 1);
